using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace yy.blog.fileServices.Services.Dto
{
    public class Base64StrInfo
    {

        private string fileName;
        private string fileSuffix;

        public string FileName { get => fileName; set => fileName = value ?? Guid.NewGuid().ToString(); }
        public string Content { get => content; set => content = value??DefaultCotent; }
        public string FileSuffix { get => fileSuffix; set => fileSuffix = value ?? ".png"; } 
        
        private string DefaultCotent = "";
        private string content;
    }
}
